import React from "react";
import "../../Styles/navbar.css";
const NavbarComponent = props => {
    return (
        <>
        <div class="fixed vw100 ta-center">
            <h2>logo</h2>
        </div>
        <div id="nav-menu" class="fixed">
            <p class="small-text">hitbox for menu</p>
        </div>
        </>
    )
}
